import React from "react";
import ErrorBoundary from "./ErrorBoundary";

function Hero({Heroname}){
    if(Heroname==='Joker')throw new Error('not a hero!')
    return(
        <div>
            <h1>Hero- {Heroname}</h1>
        </div>
    )
}

export default Hero;
